import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.Fragment>
    <h1>Netflix Best</h1>
    <p>This show best from Netflix 2021</p>
    <ol>
      <li>GOT</li>
      <li>F.R.I.E.N.D.S</li>
      <li>Lock</li>
      <li>Marvel</li>
      <li>Red</li>
      <li><App /></li>

    </ol>
    <React.Fragment>
    <h1>Netflix Best</h1>
    <p>This show best from Netflix 2021</p>
    <ol>
      <li>GOT</li>
      <li>F.R.I.E.N.D.S</li>
      <li>Lock</li>
      <li>Marvel</li>
      <li>Red</li>
      <li><App /></li>

    </ol>

  </React.Fragment>,
  </React.Fragment>,

  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
